        public async Task AddNewOrganization()
        {
            dictionary = await firebaserOrganization.GetAllUsers("DN_Organizations");

            if (imageAdm == null)
            {
                imageAdm = "";

            }
            if (imageLogo == null)
            {
                imageLogo = "";
            }

            char[] phoneArray = PhoneNumnberBox.Text.ToCharArray();

            if (phoneArray[4] == '0')
            {
                await DisplayAlert("Attention!", "Your phone number is incorrect.", "Close");
                int a = int.Parse("Amisi");
            }

            if (dictionary!= null)
            {

                foreach (var onePhone in valueList)
                {
                    if (DataConverter.ConvertToString(onePhone.PhoneNumber).Equals(PhoneNumnberBox.Text))
                    {
                        isPhoneNumberExisting = true;
                        break;
                    }
                }

            }

            CheckInUSersTable();

            if (!isPhoneNumberExisting)
            {
                OrganizationProperties org = new OrganizationProperties();
                org.Image = imageAdm;
                org.ImageID = imageLogo;
                org.OGName = DataConverter.ConvertToByteArray(NameBox.Text);
                org.AdminName = DataConverter.ConvertToByteArray(AdmNameBox.Text);
                org.UserName = DataConverter.ConvertToByteArray(userBox.Text);
                org.Email= DataConverter.ConvertToByteArray(EmailBox.Text);
                org.PhoneNumber = DataConverter.ConvertToByteArray(PhoneNumnberBox.Text);
                org.Address = DataConverter.ConvertToByteArray(Adress.Text);
                org.Password = DataConverter.ConvertToByteArray(PassWord.Text);
                org.InfoSummary = DataConverter.ConvertToByteArray(Summary.Text);
                GetServices();
                org.orgServices = servicesList_Strings;
                org.HowToAccess = DataConverter.ConvertToByteArray(ServicesAccess.Text);
                org.ContactServices = DataConverter.ConvertToByteArray(Contacts.Text);
                loadingImage.IsVisible = true;
                loadingImage.IsRunning = true;
                firebaserOrganization.AddNewUser(org, "DN_Organizations");

                loadingImage.IsRunning = false;
                loadingImage.IsVisible = false;
                await DisplayAlert("Done!", "Successfully registered!", "OK");
                Navigation.RemovePage(this);

                imageAdm = null; 
            }

            else
            {

                await DisplayAlert("Attention!", "This phone number already exists.", "Close");
                isPhoneNumberExisting = false;
            }

        }

        public async void ORGRegister()
        {
            try
            {
                if (NameBox.Text.Length > 2)
                {
                    if (EmailBox.Text.Length > 10 && EmailBox.Text.Contains("@") && EmailBox.Text.Contains("."))
                    {
                        if (AdmNameBox.Text.Length > 3)
                        {
                            if (userBox.Text.Length > 3)
                            {
                                if (PhoneNumnberBox.Text.Length > 8)
                                {
                                    if (Adress.Text.Length > 4)
                                    {
                                        if (PassWord.Text.Length > 7)
                                        {
                                           await AddNewOrganization();
                                        }
                                        else
                                        {
                                            await DisplayAlert("Attention!", "Your Password is less than 8 charaters", "Close");
                                        }
                                    }
                                    else
                                    {
                                        await DisplayAlert("Attention", "Please! Enter your address", "OK");
                                    }

                                }
                                else
                                {
                                    await DisplayAlert("Attention!", "Your Phone number should be at least 9 numbers", "OK");
                                }

                            }
                            else
                            {
                                await DisplayAlert("Attention!", "The userName should be at least 4 characters.", "OK");
                            }
                        }
                        else
                        {
                            await DisplayAlert("Attention!", "The Organization name should at least be 4 characters.", "OK");
                        }
                    }
                    else
                    {
                        await DisplayAlert("Error!", "Your email is not correct", "Close");
                    }
                }
                else
                {
                    await DisplayAlert("Error!", "The name is not correct", "Close");
                }
            }
            catch (Exception)
            {
                loadingImage.IsVisible = false;
                loadingImage.IsRunning = false;
                registerButton.Opacity = 1;

                await DisplayAlert("Attention!", "Fill in all the information please!", "OK");
            }

            loadingImage.IsVisible = false;
            loadingImage.IsRunning = false;
            registerButton.Opacity = 1;

        }

