        private async void CheckInUSersTable()
        {

          dictionary = await firebaserOrganization.GetAllUsers("DN_Organizations");

            if (!isPhoneNumberExisting)
            {
                if (dictionary != null)
                {
                    valueList = dictionary.Select(V => V.Value).ToList();
                    keyList = dictionary.Select(K => K.Key).ToList();

                    foreach (var onePhone in valueList)
                    {
                        if (DataConverter.ConvertToString(onePhone.PhoneNumber).Equals(phoneRegister))
                        {
                            isPhoneNumberExisting = true;
                            break;
                        }
                    }
                }
            }
        }


        public void GetServices()
        {
            servicesList.Add(reg);
           
            foreach (var item in servicesList)
            {
                List<String> moreList = new List<string>();

                foreach (var item2 in item.More)
                {
                    
                     moreList.Add(item2.Text);
                    
                }
                servicesList_Strings.Add(new Temp_String_Services_Class { Title = item.Title.Text, Content = item.Content.Text, More = moreList });
            }
            
        }
